import React, { useState } from "react";
import "./index.css";

import Modal from "./modal";

const MyModal = ({
  visible,
  tabState,
  children,
  setTabState,
  titleText,
  handleVisible,
  width,
  inputValue,
  setInputValue,
}) => {
  return (
    <div className={visible ? "modalopen" : "modalclosed"}>
      <Modal
        width={width}
        titleText={titleText}
        setTabState={setTabState}
        handleVisible={handleVisible}
        inputValue={inputValue}
        setInputValue={setInputValue}
      >
        {children}
        {/*tabState:{tabState}*/}
      </Modal>
    </div>
  );
};

export default MyModal;
